import path from "path";
import fs from "fs";

export default function Index({ entries }) {
  return (
    <div>
      {entries.map(({ html }, idx) => (
        <div key={idx} dangerouslySetInnerHTML={{ __html: html }} />
      ))}
    </div>
  );
}

export async function getStaticProps() {
  const entriesDir = path.join(process.cwd(), "entries");
  console.log(entriesDir);
  const filenames = fs.readdirSync(entriesDir);

  return {
    props: { entries: filenames.map((f) => ({ __html: f })) },
  };
}
